\"Cookie Clicker\" pour mettre en pratique les techniques d\'interaction et d\'animation en CSS et en JavaScript, la manipulation du DOM et la logique algorithmique.</h4><h4 style=\"letter-spacing: normal;\">Lien GitHub : <a href=\"https://github.com/yoramtaieb/Cookie_clicker_game\" target=\"_blank\" rel=\"noopener noreferrer\">https://github.com/yoramtaieb/Cookie_clicker_game</a></h4>		\n										<img width=\"2880\" height=\"1534\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.45.15.png\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.45.15.png 2880w, http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.45.15-1536x818.png 1536w, http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.45.15-2048x1091.png 2048w\" sizes=\"(max-width: 2880px) 100vw, 2880px\" />											\n		<h4 style=\"letter-spacing: normal;\">Projet VirtualVirus : En utilisant du HTML, CCS et du JavaScript, le but de ce projet était de faire un site responsive et fonctionnel. Nous devions également intégrer un bouton toggle qui permet de passer le site en mode Dark.</h4><h4 style=\"letter-spacing: normal;\">Lien GitHub : <a href=\"https://github.com/yoramtaieb/Virtual_virus\" target=\"_blank\" rel=\"noopener noreferrer\">https://github.com/yoramtaieb/Virtual_virus</a></h4>		\n										<img width=\"2880\" height=\"1534\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.58.59.png\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.58.59.png 2880w, http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.58.59-1536x818.png 1536w, http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.58.59-2048x1091.png 2048w\" sizes=\"(max-widt