				<img width=\"2880\" height=\"1534\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.58.59.png\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.58.59.png 2880w, http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.58.59-1536x818.png 1536w, http://localhost:8888/wordpress/wp-content/uploads/2020/06/Capture-d’écran-2020-06-11-à-22.58.59-2048x1091.png 2048w\" sizes=\"(max-width: 2880px) 100vw, 2880px\" />','PROJETS','','inherit','closed','closed','','837-revision-v1','','','2020-06-11 22:59:32','2020-06-11 20:59:32','',837,'http://localhost:8888/wordpress/2020/06/11/837-revision-v1/',0,'revision','',0),(862,1,'2020-06-11 23:02:55','2020-06-11 21:02:55','<h1>YORAM TAIEB</h1>		\n			<h1><b>Développeur Web Full Stack JavaScript</b></h1>		\n		<h5 style=\"text-align: center;\"><i>Bonjour à tous, je m\'appel Yoram, j\'ai 19ans. Je suis actuellement en formation Développeur Web Full Stack JavaScript. </i></h5><h5 style=\"text-align: center;\"><i>J\'aime apprendre chaque jour et découvrir de nouvelles technologies. J\'ai toujours étais passionné par l\'informatique. </i></h5>		\n										<img width=\"768\" height=\"768\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2020/06/82ea30c4-d1dd-4d7b-83f2-4cf39d900527-1-768x768.jpeg\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2020/06/82ea30c4-d1dd-4d7b-83f2-4cf39d900527-1-768x768.jpeg 768w, http://localhost:8888/wordpress/wp-content/uploads/2020/06/82ea30c4-d1dd-4d7b-83f2-4cf39d900527-1-300x300.jpeg 300w, http://localhost:8888/wordpress/wp-content/uploads/2020/06/82ea30c4-d1dd-4d7b-83f2-4cf39d900527-1-1024x1024.jpeg 1024w, http://localhost:8888/wordpress/wp-content/uploads/2020/06/82ea30c4-d1dd-4d7b-83f2-4cf39d900527-1-150x150.jpeg 150w\" sizes=\"(max-width: 768px) 100vw, 768px\" />','MOI','','inherit','closed','closed','','810-revision-v1'